import React from "react";
import styles from "../scss/home.module.scss";
import test from "../assets/test.svg";
const Home = () => {
  return (
    <div>
      <div className={styles.heroContainer}>
        <div>
          <test />
        </div>
      </div>
      <div>Nav panel</div>
    </div>
  );
};

export default Home;
